import React from "react";

export default function App() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-white text-black">
      <h1 className="text-4xl font-bold mb-4">Welcome to SWAI</h1>
      <p className="text-lg text-gray-600 text-center max-w-xl px-4">
        Shop With AI — describe your project and budget, and we’ll build a full setup for you, 
        from screens to accessories. All in one click.
      </p>
    </div>
  );
}
